import React from 'react';

const Navbar = ({ selectedCategory, onCategoryChange }) => {
  const categories = [
    { id: 'all', label: 'All Products' },
    { id: 'skincare', label: 'Skincare' },
    { id: 'makeup', label: 'Makeup' },
    { id: 'perfumes', label: 'Perfumes' },
    { id: 'other cosmetics', label: 'Other Cosmetics' }
  ];

  return (
    <nav className="navbar">
      <div className="navbar-content">
        <div className="filter-buttons">
          {categories.map(category => (
            <button
              key={category.id}
              className={`filter-btn ${selectedCategory === category.id ? 'active' : ''}`}
              onClick={() => onCategoryChange(category.id)}
            >
              {category.label}
            </button>
          ))}
        </div>
        <div className="social-icons">
        <a href="https://wa.me/201055001378" target="_blank" rel="noopener noreferrer" className="whatsapp">
          <i className="fab fa-whatsapp"></i>
        </a>
        <a href="https://www.instagram.com/skincarebybasbosa?igsh=MXN6YjkyNzEwaHMzbA%3D%3D&utm_source=qr" target="_blank" rel="noopener noreferrer" className="instagram">
          <i className="fab fa-instagram"></i>
        </a>
        <a href="https://www.tiktok.com/@bascare02?_t=ZS-8ziu7nAzPsu&_r=1 " target="_blank" rel="noopener noreferrer" className="tiktok">
          <i className="fab fa-tiktok"></i>
        </a>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
